import React from 'react'
import Color from './Color'

let vacationSpots = [
    {
      place: "Meridian, Idaho",
      price: 40,
      timeToGo: "Spring"
    },{
      place: "Cancun",
      price: 900,
      timeToGo: "Winter"
    },{
      place: "China",
      price: 1200,
      timeToGo: "Fall"
    },{
      place: "Russia",
      price: 1100,
      timeToGo: "Summer"
    },{
      place: "Lebanon",
      price: 400,
      timeToGo: "Spring"
    }
  ]

const ColorBox = () => {

    const mappedSpots = vacationSpots.map((newCard)=>{
        return <CardsTemp card={newCard} />
    })
    return (
        <div id='newSpots'>
            {mappedSpots}
        </div>
    )
}

export default ColorBox
